import styled from 'styled-components';

export const BurgerIngridients = styled.div`
    width: 100%;
    height: calc(100% - 50px);
    overflow-y: scroll;
    &::-webkit-scrollbar {
        display: none;
    }
    display: flex;
    flex-direction: column;
    padding-top: 25 0px;
`
